 "use strict";document.addEventListener("DOMContentLoaded",()=>{let e=document.querySelectorAll(".mod_memberPictureFeedUpload .fineuploader-container");if(e)for(let t of e)t.addEventListener("click",e=>{e.stopPropagation();let t=e.target,l=t.parentNode;if(l){let o=l.querySelector('input[type="file"][name="fileupload_fineuploader"]');o&&o.click()}})});